INSERT INTO `about` (`id`, `html`) VALUES
(1, '<div style="text-align: center;"><img src="images/cody.jpg" style="border-radius: 50%; width: 200px;">\r\n<br>\r\n<br>\r\nI''m Cody Seibert and this is my personal project and blog site!\r\n</div>\r\n<br>\r\n<div style="text-align: center;">\r\n<a href="files/Resume_Of_Cody_Seibert.pdf"  target="_blank"><img style="width: 50px;" src="images/pdf.png"> resume.pdf</a>\r\n</div>\r\n<br><br>\r\n\r\nThis site is a way for me to keep track of the various projects I have worked on in the past and the new projects I continue to work on in the future.  Additionally, I  wanted a site to post any of my random blog entries.  \r\n<br><br>\r\nI graduated from UCF with a Bachelors of Science in Computer Science May 2nd, 2013.  Shortly after, I started working as a software engineer at Harris Corporation in Melbourne, FL.  Using the knowledge obtained, I am now pursuing other endeavors as I search for a job more honed towards my area of interested: web development.\r\n<br><br>\r\nWhen I am not spending my time programming, I am usually doing one of the many other things I enjoy such as rock climbing, playing piano, drawing, or making music in my home town of Oviedo, FL.');

